    "j-clark-salyer-national-wildlife-refuge-annual-narrative-report-calendar-year-1994",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for J. Clark
    Salyer National Wildlife Refuge outlines Refuge accomplishments during the 1994
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. The report includes a planning section which discusses compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, other manpower
    programs, volunteer programs, funding, and safety is given. Habitat management is
    also covered; subjects include wetlands, forests, grasslands, haying, fire management,
    pest control, and wilderness and special areas. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, other migratory birds, other resident wildlife,
    fisheries resources, and marking and banding. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    wildlife observation, picnicking, and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment utilization and replacement, and computer systems. Cooperative programs
    are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
